import React from "react";
import Header from '../components/Header';
import MainFreepost from '../components/MainFreepost';
import Footer from '../components/Footer';

const Freepost=()=> {
  return (
    <div id="page-wrapper">
      <Header />
      <MainFreepost/>
      <Footer />
    </div>
  )
}
export default Freepost;
